        {
            if (!(unit is TorqueUnit unitAsTorqueUnit))
                throw new ArgumentException($"The given unit is of type {unit.GetType()}. Only {typeof(TorqueUnit)} is supported.", nameof(unit));

            return As(unitAsTorqueUnit);
